Back to my second home, Nashville Tennessee, to live my all american Abercrombie cowgirl life for the week.

@hannahhmetz isn’t back from the Caribbean yet so I’m pretending her house, pets, and land are mine until she’s gets here.

Giddy up!🤠

Few things:

1. 👾Adobe Firefly is out (AI Generator for photoshop) and it’s already changed my editing game. Shit is actually insane. So cool.
@photoshop 

2. 🐍Daddy Dommy and mama Nelly’s new song Eat Your Man is finally out and I’m about to run it into the ground. HEAT
@domdolla x @nellyfurtado 

3. 🌈 Happy Pride! I just got confirmation that I’m DJing a handful of parties in July and I am so excited to throw down with you.
@richssandiego 

4.🌽I’m visiting family back in Indiana right now and she’s tryna keep me here all summer with this sunshine. June gloom could never.

Happy Friday :)
